import React, { Component } from 'react';

class List extends Component{
    constructor(props){
        super(props);
        this.state = {
            list : [
              {id: 1, content: 'message1'},
              {id: 2, content: 'message2'},
              {id: 3, content: 'message3'},
              {id: 4, content: 'message4'},
              {id: 5, content: 'message5'}
          ]
        }
    }

    // componentDidMount(){
    //     this.getList();
    // }

    // getList = () => {
    //     fetch('localhost:4006')
    //     .then(res =>res.json())
    //     .then(list => this.setState({list}))

    // }

    render(){

        const {list} = this.state;

        return (
            <div className="App">
              <h1>List of Items</h1>
              {list.length ? (
                <div>
                  {list.map((item) => {
                    return(
                      <div>
                        {item.id}
                      </div>
                    );
                  })}
                </div>
              ) : (
                <div>
                  <h2>No List Items Found</h2>
                </div>
              )
            }
            </div>
          );

        }
            
}

export default List;
